import { PanelMenu } from "primereact/panelmenu";
import RemoveItem from "./RemoveItem";
import NewQuest from "./NewQuest";
import NewNPC from "./NewNPC";

const NPCs = (quest) => {
  const items = [
    {
      label: "NPC's",
      icon: "pi pi-fw pi-book",
      items: [
        {
          label: <NewNPC />,

        },
        {
          label: <RemoveItem quest={quest}/>,
        },
      ],
    },
  ];

  return (
    <>
      <PanelMenu 
      model={items} 
      />
    </>
  );
};

export default NPCs;
